import { BrowserRouter, Route, Switch } from "react-router-dom";
import Home from "./view/Home";

const Routes = () => {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/" exact>
          <Home />
        </Route>
      </Switch>
    </BrowserRouter>
  );
};

export default Routes;
